import React from 'react';
import styles from './navbar.module.css';
import '../bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-scroll';
import {Navbar,Nav} from 'react-bootstrap';

const navLinks = [
    {
        label: 'Contact',
        to: 'mycontact'
    },
    {
        label: 'Projects',
        to: 'myprojects'
    },
    {
        label: 'Skills',
        to: 'myskills'
    },
    {
        label: 'Services',
        to: 'myservices'
    },
    {
        label: 'About',
        to: 'herosection'
    },
    {
        label: 'Home',
        to: 'navbar'
    },
]

const NavBar = () => {


    return (
        <Navbar bg="dark" variant="dark" expand="lg" id='navbar'>
        <Navbar.Brand as={Link} to="navbar" spy={true} smooth={true} offset={-70} duration={500}>
            <p>Your Logo</p>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ml-auto">
            {
            navLinks.map((link, index) => (
              <Nav.Link
                as={Link}
                to={link.to}
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
                key={index}
              >
                {link.label}
              </Nav.Link>
            ))
            }
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
}

export default NavBar;
